const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]
  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
      <Total parts={parts} />
    </div>
  )
}

const Header = props => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Content = props => {
  return (
    <div>
      <p>

      </p>
      <p>

      </p>
      <p>

      </p>
    </div>
  )
}

const Total = props => {
  let parts = props.parts
  let ans
  parts.forEach(element => {
    ans += element.exercises
  });
  return (
    <div>
      <p>Number of exercises {ans}</p>
    </div>
  )
}


export default App
